import React from "react";

const MyInput = ({ ...props }) => {
  return (
    <input
      style={{
        borderRadius: 12,
        border: "1px solid #d1d1d1",
        backgroundColor: "#f9f9f9",
        padding: "12px 16px",
        outline: none,
      }}
      {...props}
    />
  );
};

export default MyInput;
